import React from "react";
import Navbar from "../../Components/Navbar/Navbar";
import "./Home.css";

const Home = () => {
  const renderComponent = () => {
    return (
      <>
        <Navbar />

        <div className="container">
          <input className="main" />
          <span className="searchicon"></span>
          <div className="microphone">
            <div className="mic-stand"></div>
          </div>
          <div className="icon-holder">
            <div className="icon" id="parking">
              <div className="tooltip">Parking</div>
            </div>
            <div className="icon" id="gas">
              <div className="base"></div>
              <div className="tooltip">Gas</div>
            </div>
            <div className="icon" id="eat">
              <div className="fork"></div>
              <div className="knife"></div>
              <div className="tooltip">Food</div>
            </div>
            <div className="icon" id="coffee">
              <div className="cup"></div>
              <div className="tooltip">Coffee</div>
            </div>
            <div className="icon" id="misc">
              <div className="dots"></div>
              <div className="tooltip">Misc</div>
            </div>
          </div>
        </div>
      </>
    );
  };
  return renderComponent();
};

export default Home;
